import React, { Component } from 'react';

class Wishlist extends Component {
    constructor(props) {
        super(props);
        this.state = {
            query: this.props.location.query,
            accessable: false
        }

    }
    componentDidMount() {
        if (this.state.query === "passcode!") {
            this.setState({
                accessable: true
            })
        }
    }
    render() {
        return (
            <div>
                <h1>Wishlist</h1>
                {this.state.accessable ? (
                    <div></div>
                ) : (
                        <div></div>
                    )}
            </div>

        );
    }
}

export default Wishlist;
